import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const Dashboard: React.FC = () => {
  const navigate = useNavigate();
  const [userData, setUserData] = useState({
    name: 'Имя пользователя',
    email: 'email@example.com',
    subscription: {
      plan: '1 месяц',
      expiryDate: '10.11.2024',
      vpnKey: 'your-vpn-key',
    },
  });

  const handleCopyKey = () => {
    navigator.clipboard.writeText(userData.subscription.vpnKey)
      .then(() => {
        alert('VPN-ключ скопирован!');
      })
      .catch((err) => {
        console.error('Ошибка копирования:', err);
      });
  };

  const handleSubscriptionRenewal = () => {
    navigate('/dashboard'); // Перенаправляем на выбор тарифов для продления подписки
  };

  return (
    <div className="min-h-screen bg-gray-100 p-8">
      <h1 className="text-4xl font-bold text-gray-800 mb-6">Личный кабинет</h1>

      {/* Информация о пользователе */}
      <div className="bg-white shadow-md rounded-lg p-6 mb-8">
        <h2 className="text-2xl font-semibold mb-4">Информация о пользователе</h2>
        <p className="text-lg"><strong>Имя:</strong> {userData.name}</p>
        <p className="text-lg"><strong>Email:</strong> {userData.email}</p>
      </div>

      {/* Информация о подписке */}
      <div className="bg-white shadow-md rounded-lg p-6 mb-8">
        <h2 className="text-2xl font-semibold mb-4">Информация о подписке</h2>
        <p className="text-lg"><strong>Тариф:</strong> {userData.subscription.plan}</p>
        <p className="text-lg"><strong>Действует до:</strong> {userData.subscription.expiryDate}</p>
        <div className="flex items-center mt-4">
          <p className="text-lg mr-4"><strong>Ваш VPN-ключ:</strong> {userData.subscription.vpnKey}</p>
          <button
            onClick={handleCopyKey}
            className="bg-blue-500 text-white px-4 py-2 rounded-lg hover:bg-blue-600 transition-colors"
          >
            Копировать ключ
          </button>
        </div>
      </div>

      {/* Настройки подписки */}
      <div className="bg-white shadow-md rounded-lg p-6 mb-8">
        <h2 className="text-2xl font-semibold mb-4">Настройки подписки</h2>
        <button
          onClick={handleSubscriptionRenewal}
          className="bg-green-500 text-white px-4 py-2 rounded-lg hover:bg-green-600 transition-colors"
        >
          Продлить подписку
        </button>
      </div>

      {/* Настройки аккаунта */}
      <div className="bg-white shadow-md rounded-lg p-6">
        <h2 className="text-2xl font-semibold mb-4">Настройки аккаунта</h2>
        <p className="text-lg mb-2">Здесь можно изменить пароль или настройки безопасности.</p>
        <button className="bg-gray-500 text-white px-4 py-2 rounded-lg hover:bg-gray-600 transition-colors">
          Изменить пароль
        </button>
      </div>
    </div>
  );
};

export default Dashboard;
